import jsPDF from 'jspdf'
import qrGenerator from './qrGenerator';

const pdfGenerator = async (placeId, placeName) => {
  let imgData = 'data:image/png;base64,'

  let northImgData = 'data:image/png;base64,'

  try {
    let qrPlaceId = await qrGenerator(placeId)
    var doc = new jsPDF()
    doc.setFontSize(10)
    doc.addImage(qrPlaceId, 'PNG', 30, -2, 155, 155, null, 'FAST')
    doc.addImage(northImgData, 'PNG', 5, 20, 20, 40, null, 'FAST')
    doc.text(30, 8, `${placeName}: ${placeId}`)
    doc.addImage(imgData, 'PNG', 32, 143, 150, 150, null, 'FAST')
    doc.save(`qr-marker-${placeId}.pdf`)
  }catch (err) {
    console.error(err)
  }
}

export default pdfGenerator